  state = {
    temp : undefined,
    city : undefined,
    country : undefined ,
    sunrise : undefined,
    sunset : undefined,
    isShowing: false,
    error : undefined
  }




  render() {
    return(
      <div className="wrapper">
        <div className="container">
              <Info/>
              <ReduxTest />

        </div>
      </div>
    )
  }
}

export default App;
